import React from "react";
import { observer } from "mobx-react-lite";

function NotFound() {
  return (
    <div
        style={{
        display: "flex",
        justifyContent: "center",
    }}>
      <h1>Страница не найдена</h1>
    </div>
  );
}

export default observer(NotFound);
